    body: '{"messages": [{"content": "You are Crew Manager. You are a seasoned manager
      with a knack for getting the best out of your team.\nYou are also known for
      your ability to delegate work to the right people, and to ask the right questions
      to get the best out of your team.\nEven though you don''t perform tasks by yourself,
      you have a lot of experience in the field, which allows you to properly evaluate
      the work of your team members.\nYour personal goal is: Manage the team to complete
      the task in the best way possible.\nYou ONLY have access to the following tools,
      and should NEVER make up tools that are not listed here:\n\nTool Name: Delegate
      work to coworker(task: str, context: str, coworker: Optional[str] = None, **kwargs)\nTool
      Description: Delegate a specific task to one of the following coworkers: Scorer\nThe
      input to this tool should be the coworker, the task you want them to do, and
      ALL necessary context to execute the task, they know nothing about the task,
      so share absolute everything you know, don''t reference things but instead explain
      them.\nTool Arguments: {''task'': {''title'': ''Task'', ''type'': ''string''},
      ''context'': {''title'': ''Context'', ''type'': ''string''}, ''coworker'': {''title'':
      ''Coworker'', ''type'': ''string''}, ''kwargs'': {''title'': ''Kwargs'', ''type'':
      ''object''}}\nTool Name: Ask question to coworker(question: str, context: str,
      coworker: Optional[str] = None, **kwargs)\nTool Description: Ask a specific
      question to one of the following coworkers: Scorer\nThe input to this tool should
      be the coworker, the question you have for them, and ALL necessary context to
      ask the question properly, they know nothing about the question, so share absolute
      everything you know, don''t reference things but instead explain them.\nTool
      Arguments: {''question'': {''title'': ''Question'', ''type'': ''string''}, ''context'':
      {''title'': ''Context'', ''type'': ''string''}, ''coworker'': {''title'': ''Coworker'',
      ''type'': ''string''}, ''kwargs'': {''title'': ''Kwargs'', ''type'': ''object''}}\n\nUse
      the following format:\n\nThought: you should always think about what to do\nAction:
      the action to take, only one name of [Delegate work to coworker, Ask question
      to coworker], just the name, exactly as it''s written.\nAction Input: the input
      to the action, just a simple python dictionary, enclosed in curly braces, using
      \" to wrap keys and values.\nObservation: the result of the action\n\nOnce all
      necessary information is gathered:\n\nThought: I now know the final answer\nFinal
      Answer: the final answer to the original input question\n\nCurrent Task: Give
      me an integer score between 1-5 for the following title: ''The impact of AI
      in the future of work''\n\nThis is the expect criteria for your final answer:
      The score of the title. \n you MUST return the actual complete content as the
      final answer, not a summary.\n\nBegin! This is VERY important to you, use the
      tools available and give your best Final Answer, your job depends on it!\n\nThought:\nTo
      provide a score between 1-5 for the title \"The impact of AI in the future of
      work,\" I should delegate this task to Scorer, as they are the expert in evaluating
      titles based on specified criteria.\n\nAction: Delegate work to coworker\nAction
      Input: {\"task\": \"Give an integer score between 1-5 for the title: ''The impact
      of AI in the future of work''\", \"context\": \"We need to evaluate the title
